import React from "react";
import './FootBall.css'
import footimg from  '../image/img9.jpg';
function FootBall() {
    return (
      <>

        <div className="FootBall">
      <div>
      <h1>FootBall</h1>
        <img src={footimg} alt="BigCo Inc. logo"/>
      </div>
      </div>
      </>
    );
  }
export default FootBall;
